function NameList (props) {
  const names = props.names;
  const listItems = names.map((names) => <li key={names.toString}>{names}</li>);
return (
  <ul>{listItems}</ul>
)
}

function App() {
  const names = [{'fname':'Anders','lname':'Henriksen'},{'fname':'Britta','lname':'Albertsen'},{'fname':'Kalle','lname':'Fredborg'}]
  return (
    <div className="App">
  <NameList names={names}/>
  </div>
  );
}

class Dateshow extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      date : new Date()
    };
  }

  render() {
    return (
      <div>
        <p>Date: {this.state.date.toString()} </p>
        <button onClick={() => this.setState({ date: new Date()})}>
          Click me for a date
        </button>
      </div>
    );
  }
}




export default Dateshow;
